const starry_encrypt_icon = "data:image/png;base64,";

const starry_encrypt_picture = "data:image/png;base64,";
const starryEncrypt_extensionId = "StarryEncrypt";

class StarryEncrypt {
    constructor(runtime) {
        this.lastEncryptedText = null;
        this.lastDecryptedText = null;
        this._formatMessage = runtime.getFormatMessage({
            "zh-cn": {
                "StarryEncrypt.name": "简单加密",
                "StarryEncrypt.bin": "二进制",
                "StarryEncrypt.dec": "十进制",
                "StarryEncrypt.hex": "十六进制",
                "StarryEncrypt.ths": "三十六进制",
                "StarryEncrypt.cae": "凯撒密码",
                "StarryEncrypt.bac": "培根密码(无法设置密钥)",
                "StarryEncrypt.key": "密钥",
                "StarryEncrypt.docs": "📖拓展教程",
                "StarryEncrypt.encrypt": "以 [type] 加密 [TEXT] 密钥 [KEY]",
                "StarryEncrypt.decrypt": "以 [type] 解密 [TEXT] 密钥 [KEY]",
                "StarryEncrypt.lastText": "最近 [ENDE] 的文本",
                "StarryEncrypt.dig": "随机生成 [dig] 位数",
                "StarryEncrypt.modern": "现代加密法",
                "StarryEncrypt.classical": "古典加密法(⚠️相关限制查看扩展文档)",
                "StarryEncrypt.enlast": "加密",
                "StarryEncrypt.delast": "解密",
                "StarryEncrypt.more": "其他",
            },
            en: {
                "StarryEncrypt.name": "Simple Encrypt",
                "StarryEncrypt.bin": "Two Base",               
                "StarryEncrypt.dec": "Ten Base",
                "StarryEncrypt.hex": "Sixteen Base",
                "StarryEncrypt.ths": "Thirty-two Base",
                "StarryEncrypt.cae": "Caesar Code",
                "StarryEncrypt.bac": "Bacon Code(Unable to set a key)",
                "StarryEncrypt.key": "Key",
                "StarryEncrypt.docs": "📖 Tutorial",
                "StarryEncrypt.encrypt": "Encrypt [TEXT] key [KEY] with [type]",
                "StarryEncrypt.decrypt": "Decrypt [TEXT] key [KEY] with [type]",
                "StarryEncrypt.lastText": "The last [ENDE] text",
                "StarryEncrypt.dig": "[dig] digit number is randomly generated",
                "StarryEncrypt.modern": "Modern encryption",
                "StarryEncrypt.classical": "Classical encryption(⚠️For related limitations, see the extended documentation)",
                "StarryEncrypt.enlast": "Encrypt",
                "StarryEncrypt.delast": "Decrypt",
                "StarryEncrypt.more": "More",
            }
        })
    }

    formatMessage(id) {
        return this._formatMessage({
            id,
            default: id,
            description: id
        });
    }

    getInfo() {
        return {
            id: starryEncrypt_extensionId,
            name: this.formatMessage("StarryEncrypt.name"),
            blockIconURI: starry_encrypt_icon,
            menuIconURI: starry_encrypt_icon,
            color1: "#EC3838",
            color2: "#B32B2B",
            blocks: [
                {
                    blockType: "button",
                    text: this.formatMessage('StarryEncrypt.docs'),
                    onClick: this.docs,
                },
                "---" + this.formatMessage("StarryEncrypt.modern"),
                // 加密
                {
                    opcode: "xdencrypt",
                    blockType: "reporter",
                    text: this.formatMessage("StarryEncrypt.encrypt"),
                    arguments: {
                        TEXT: {
                            type: "string",
                            defaultValue: "Hello"
                        },
                        KEY: {
                            type: "string",
                            defaultValue: "12345"
                        },
                        type: {
                            type: "string",
                            menu: 'type',
                        },
                    }
                },
                // 解密
                {
                    opcode: "xddecrypt",
                    blockType: "reporter",
                    text: this.formatMessage("StarryEncrypt.decrypt"),
                    arguments: {
                        TEXT: {
                            type: "string",
                            defaultValue: "Hello"
                        },
                        KEY: {
                            type: "string",
                            defaultValue: "12345"
                        },
                        type: {
                            type: "string",
                            menu: 'type',
                        },
                    }
                },
                "---" + this.formatMessage("StarryEncrypt.classical"),
                // 加密
                {
                    opcode: "gdencrypt",
                    blockType: "reporter",
                    text: this.formatMessage("StarryEncrypt.encrypt"),
                    arguments: {
                        TEXT: {
                            type: "string",
                            defaultValue: "Hello"
                        },
                        KEY: {
                            type: "string",
                            defaultValue: "12"
                        },
                        type: {
                            type: "string",
                            menu: 'type2',
                        },
                    }
                },
                // 解密
                {
                    opcode: "gddecrypt",
                    blockType: "reporter",
                    text: this.formatMessage("StarryEncrypt.decrypt"),
                    arguments: {
                        TEXT: {
                            type: "string",
                            defaultValue: "Hello"
                        },
                        KEY: {
                            type: "string",
                            defaultValue: "12"
                        },
                        type: {
                            type: "string",
                            menu: 'type2',
                        },
                    }
                },
                "---" + this.formatMessage("StarryEncrypt.more"),
                // 随机生成数字
                {
                    opcode: "digRandom",
                    blockType: "reporter",
                    text: this.formatMessage("StarryEncrypt.dig"),
                    arguments: {
                        dig: {
                            type: "string",
                            defaultValue: "5"
                        },
                    }
                },
                // 上次加密/解密的文本
                {
                    opcode: "lastText",
                    blockType: "reporter",
                    text: this.formatMessage("StarryEncrypt.lastText"),
                    arguments: {
                        ENDE: {
                            type: "string",
                            menu: 'type1',
                        },
                    }
                }
            ],
            menus: {
                type: [
                    {
                        text: this.formatMessage('StarryEncrypt.bin'),
                        value: 'bin'
                    },
                    {
                        text: this.formatMessage('StarryEncrypt.dec'),
                        value: 'dec'
                    },
                    {
                        text: this.formatMessage('StarryEncrypt.hex'),
                        value: 'hex'
                    },
                  ],
                type1: [
                    {
                        text: this.formatMessage('StarryEncrypt.enlast'),
                        value: 'encr'
                    },
                    {
                        text: this.formatMessage('StarryEncrypt.delast'),
                        value: 'decr'
                    },
                  ],
                type2: [
                    {
                        text: this.formatMessage('StarryEncrypt.cae'),
                        value: 'cae'
                    },
                    {
                        text: this.formatMessage('StarryEncrypt.bac'),
                        value: 'bac'
                    },
                ],
            },
        };
    }

    docs() {
        let a = document.createElement('a');
        a.href = "https://learn.ccw.site/article/a810ef3e-edfc-49ba-a70d-e10e54bf11c6";
        a.rel = "noopener noreferrer";
        a.target = "_blank";
        a.click();
    }

    // 现代加密
    xdencrypt(args) {
        if (args.type == "bin") {
            return this.binEncrypt(args);
        }
        else {
            if (args.type == "dec") {
            return this.decEncrypt(args);
            }
            else {
                if (args.type == "hex") {
                return this.hexEncrypt(args);
                }
            }
        }
    }
    
    // 现代解密
    xddecrypt(args) {
        if (args.type == "bin") {
            return this.binDecrypt(args);
        }
        else {
            if (args.type == "dec") {
            return this.decDecrypt(args);
            }
            else {
                if (args.type == "hex") {
                return this.hexDecrypt(args);
                }
            }
        }
    }

    // 古典加密
    gdencrypt(args) {
        if (args.type == "cae") {
            return this.caeEncrypt(args);
        }
        else {
            if (args.type == "bac") {
            return this.bacEncrypt(args);
            }
        }
    }
    
    // 古典解密
    gddecrypt(args) {
        if (args.type == "cae") {
            return this.caeDecrypt(args);
        }
        else {
            if (args.type == "bac") {
            return this.bacDecrypt(args);
            }
        }
    }

    // 上次加密/解密的文本
    lastText(args) {
        if (args.ENDE == "encr") {
        return this.lastEncryptedText;
        }
        else {
            if (args.ENDE == "decr") {
            return this.lastDecryptedText;
            }
        }
    }

    // 二进制加密
    binEncrypt(args) {
        let text = args.TEXT;
        let key = parseInt(args.KEY, 10);
        let encryptedText = '';
        this.lastEncryptedText = args.TEXT;
        for (let i = 0; i < text.length; i++) {
            let charCode = text.charCodeAt(i) ^ key;
            encryptedText += String.fromCharCode(charCode);
        }
        return encryptedText;
    }

    // 二进制解密
    binDecrypt(args) {
        let text = args.TEXT;
        let key = parseInt(args.KEY, 10);
        let decryptText = '';
        this.lastDecryptedText = args.TEXT;
        for (let i = 0; i < text.length; i++) {
            let charCode = text.charCodeAt(i) ^ key;
            decryptText += String.fromCharCode(charCode);
        }
        return decryptText;
    }

    // 十进制加密
    decEncrypt(args) {
        let text = args.TEXT;
        let key = parseInt(args.KEY, 10);
        let encryptedText = '';
        this.lastEncryptedText = args.TEXT;
        for (let i = 0; i < text.length; i++) {
            let charCode = text.charCodeAt(i) + key;
            encryptedText += String.fromCharCode(charCode);
        }
        return encryptedText;
    }

    // 十进制解密
    decDecrypt(args) {
        let text = args.TEXT;
        let key = parseInt(args.KEY, 10);
        let decryptedText = '';
        this.lastDecryptedText = args.TEXT;
        for (let i = 0; i < text.length; i++) {
            let charCode = text.charCodeAt(i) - key;
            decryptedText += String.fromCharCode(charCode);
        }
        return decryptedText;
    }

    // 十六进制加密
    hexEncrypt(args) {
        let text = args.TEXT;
        let key = parseInt(args.KEY, 10);
        let encryptedText = '';
        this.lastEncryptedText = args.TEXT;
        for (let i = 0; i < text.length; i++) {
            let charCodeHex = text.charCodeAt(i).toString(16).toUpperCase();
            let encryptedCharCode = (parseInt(charCodeHex, 16) + key) % 0x110000; // 限制在Unicode范围内
            encryptedText += encryptedCharCode.toString(16).toUpperCase().padStart(4, '0');
        }
        return encryptedText;
    }

    // 十六进制解密
    hexDecrypt(args) {
        let hexText = args.TEXT;
        let key = parseInt(args.KEY, 10);
        let decryptedText = '';
        this.lastDecryptedText = args.TEXT;
        for (let i = 0; i < hexText.length; i += 4) {
            let encryptedCharCode = parseInt(hexText.substr(i, 4), 16);
            let decryptedCharCode = (encryptedCharCode - key + 0x110000) % 0x110000; // 减密钥并调整范围
            decryptedText += String.fromCharCode(decryptedCharCode);
        }
        return decryptedText;
    }

    // 生成随机数
    digRandom(args) {
        const { dig } = args;
        if (isNaN(dig) || dig <= 0) {
            return null;
        }
        let randomNumber = '';
        for (let i = 0; i < dig; i++) {
            randomNumber += Math.floor(Math.random() * 10);
        }
        return randomNumber;
    }

    // 凯撒密码加密
    caeEncrypt(args) {
        let text = args.TEXT;
        let key = parseInt(args.KEY, 10);
        let encryptedText = '';
        this.lastEncryptedText = args.TEXT;
        for (let i = 0; i < text.length; i++) {
            let char = text.charAt(i);
            let charCode = char.charCodeAt(0);
            if (char.match(/[a-z]/i)) {
                let base = char === char.toUpperCase() ? 'A'.charCodeAt(0) : 'a'.charCodeAt(0);
                let offset = ((charCode - base + key) % 26) + base;
                encryptedText += String.fromCharCode(offset);
            } else {
                encryptedText += char;
            }
        }
        this.lastEncryptedText = text;
        return encryptedText;
    }

    // 凯撒密码解密
    caeDecrypt(args) {
       let text = args.TEXT;
       let key = parseInt(args.KEY, 10);
        let decryptedText = '';
        this.lastDecryptedText = args.TEXT;
        for (let i = 0; i < text.length; i++) {
            let char = text.charAt(i);
            let charCode = char.charCodeAt(0);
            if (char.match(/[a-z]/i)) {
                let base = char === char.toUpperCase() ? 'A'.charCodeAt(0) : 'a'.charCodeAt(0);
                let offset = ((charCode - base - key + 26) % 26) + base;
                decryptedText += String.fromCharCode(offset);
            } else {
                decryptedText += char;
            }
        }
        this.lastDecryptedText = text;
        return decryptedText;
    }

    // 培根密码加密
    bacEncrypt(args) {
        let text = args.TEXT.toUpperCase();
        let encryptedText = '';

        for (let i = 0; i < text.length; i++) {
            let char = text.charAt(i);
            if (char >= 'A' && char <= 'Z') {
                let index = char.charCodeAt(0) - 'A'.charCodeAt(0);
                let binary = index.toString(2).padStart(5, '0');
                encryptedText += binary.split('').map(bit => bit === '1' ? 'A' : 'B').join('');
            } else {
                encryptedText += 'E';
            }
        }

        this.lastEncryptedText = encryptedText;
        return encryptedText;
    }

    // 培根密码解密
    bacDecrypt(args) {
        let text = args.TEXT.toUpperCase();
        let decryptedText = '';

        for (let i = 0; i < text.length; i += 5) {
            let chunk = text.slice(i, i + 5);
            let binary = chunk.split('').map(char => char === 'A' ? '1' : '0').join('');
            let index = parseInt(binary, 2);
            let char = String.fromCharCode('A'.charCodeAt(0) + index);
            decryptedText += char;
        }

        this.lastDecryptedText = decryptedText;
        return decryptedText;
    }
}

